import React, { Fragment } from "react";

/* Styles */
import './content.scss'

export function Content() {
    return (
        <div className="homeContent">
            <div className="aboutSection"></div>
            <div className="opinionSection"></div>
            <div className="eventSection"></div>
        </div>
    );
}
